        <div>
            <Headeradmin/>
            <div>
                <div>
                    <form>
                        <label>Заголовок</label> <br/>
                        <input type="text" placeholder="Введите заголовок"/> <br/>
                        <label>Текст новости</label> <br/>
                        <textarea type="text" placeholder="Текст новости"/>
                        <input type="text" placeholder="Дата"/> <br/>
                        <button type="submit">Предпросмотр</button>
                        <button type="submit">Добавить новость</button>
                    </form>
                </div>
                <div></div>
                <div>
                </div>
            </div>
        </div>
    );
}

